import { Route, Routes } from "react-router-dom";
import { Home, Revision, Additions, Transfer} from './pages/pages';

function App() {
  return (
    <div>
      <Home></Home>
        <Routes>
          <Route exact path="/" component={<Home />}/>
          <Route exact path="/revision" component={<Revision />}/>
          <Route exact path="/additions" component={<Additions />}/>
          <Route exact path="/transfer" component={<Transfer />}/>
        </Routes>
    </div>
  );
}

export default App;
